import {FETCH_MEMS_SUCCESS} from "../actions/actionsType";

export default mems = (state = [], action) => {
  switch (action.type) {
    case action.FETCH_MEMS_SUCCESS:
      return [...action.state];
    default:
      return state;
  }
};
